import React from "react";
import { Link } from "react-router-dom";

function CardItem({ items }) {
  console.log(items);
  return (
    <div className="links">
      <div className="card-items col-sm-12 col-md-4 col-lg-3">
        <img src={items.flags.svg} alt="ai"></img>
        <Link to="/detail">
          <h3>{items.name.common}</h3>
        </Link>
        <p>Pupulation: {items.population}</p>
        <p>Region: {items.region}</p>
        <p>Capital: {items.capital}</p>
      </div>
    </div>
  );
}

export default CardItem;
